import React from 'react';
import { TextInput } from 'react-native';

const TextInputField = ({ value, onChangeText, placeholder }) => {
  return (
    <TextInput
    
      value={value}
      onChangeText={onChangeText}
      placeholder={placeholder}
    />
  );
};

export default TextInputField;
